import Vue from 'vue';
import VueRouter from 'vue-router';
import HomePage from '../components/HomePage.vue'; // HomePage 컴포넌트 경로
import ProductPage from '../components/ProductPage.vue'; // ProductPage 컴포넌트 경로
import PropertyPage from '../components/PropertyPage.vue'; // PropertyPage 컴포넌트 경로
import CommunityPage from '../components/CommunityPage.vue'; // CommunityPage 컴포넌트 경로

Vue.use(VueRouter);

const routes = [
  { path: '/', name: 'Home', component: HomePage },
  { path: '/product', name: 'Product', component: ProductPage },
  { path: '/property', name: 'Property', component: PropertyPage },
  { path: '/community', name: 'Community', component: CommunityPage },
];

const router = new VueRouter({
  mode: 'history',
  routes,
});

export default router;
